    "Virtual Training of Compressor Control Room Project",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:22:11.378441",nt"name": "virtual-training-of-compressor-control-room-project",nt"isopen":
    true,nt"url": null,nt"notes": "MYMIC will analyze, design, develop and
    evaluate the Virtual Control Room &amp;#150; Compressor Station (VCoR-CS) training
    system. VCoR-CS will provide procedural training to NASA operators within a 3D virtual
    environment that realistically models the Compressor Station Control Room. It will
    include an accessible information repository to store expert knowledge and Standard
    Operating Procedures for display via a simple, training interface. VCoR-CS will
    leverage a "crawl-walk-run" learning approach with practice and assessments levels
    in order to allow users to slowly increase the cognitive load and difficulty of
    their training. A log-in capability will enable user performance to be tracked and
    training to be accessed on-demand. MYMIC will evaluate the effectiveness of VCoR-CS
    training prototype and adherence to its learning objectives. Project efforts and
    results will be incorporated into a Final Report. MYMIC will also conceptualize
    the expansion of VCoR-CS to include emergency preparedness and scenario-based training
    modules for future, follow-on efforts.",nt"license_title": "U.S. Government
